import React from "react";
import { data } from "./timelineData";
import TimelineItem from "./TimelineItem";



const TimeLine = () => (
  <>
    <h1>{data.name}</h1> <div className={data.tasks[data.tasks.length-1].isComplete?"complete":"incomplete"}></div>    
        {data.tasks.map((el, index) => (
            <TimelineItem el={el} key={index} />
        ))}

        <h2>Progress:{Math.round(+data.tasks.filter(x=>x.isComplete).length/data.tasks.length*100)}%</h2>
  </>
);

export default TimeLine;
